import React from 'react'
import './ContentList.css'

function ContentList() {
  return (
    <div className="row">
      {/* data의 번호 */}
      <div className="col">1</div>
      {/* data의 제목 */}
      <div className="col">2</div>
      {/* data의 작성일자 */}
      <div className="col">3</div>
    </div>
  )
}

export default ContentList
